                    <Checkbox>Sed ut perspiciatis unde</Checkbox>
                    <Checkbox>Quis autem vel eum iure</Checkbox>
                </TabPane>
				<TabPane tab="Payment Settings" key="2"></TabPane>
			</Tabs>
        </div>
    );
}

export default settings;
